import { useSearchParams } from 'react-router-dom';
import ListResults  from './ListResults'

const Detail = () => {

  const [searchParams] = useSearchParams();
  const textToSearch =  searchParams.get('search');

  return (
    <div>
      {
        textToSearch? 
        <ListResults />
        :
        <h1>Test</h1>
      }
    </div>
  )
}

export default Detail
